const priceMap = {};
price.forEach((_price) => {
    priceMap[_price.key] = _price.name;
})
Object.keys(result).forEach((priceKey) => {
    if (priceMap[priceKey]) { //找到对应奖项
        fs.appendFileSync('result', `${priceMap[priceKey]}开始\t\n`);
        fs.appendFileSync('result', `总中奖人数：${result[priceKey].length}\t\n`);
        const priceResult = result[priceKey];
        const name = priceResult.map((id)=>{
            return JSON.stringify({
                id,
                number: mapList[id]
            });
        });
        fs.appendFileSync('result',`${name.join('\t\n')} `)
        fs.appendFileSync('result', '\t\n');
        fs.appendFileSync('result', `${priceMap[priceKey]}结束\t\n`);
    }
})